import styled from "styled-components";

const InputContainer = styled.div`
  width: 100%;
  min-height: 50px;
  margin-bottom: 20px;
  display: -ms-flexbox;
  width: 100%;
  max-width: 800px;
  display: flex;
  -ms-flex-align: center;
  align-items: center;
`;

export default InputContainer;
